      reporteFechasDetallado(){
    
        this.totalkilos = 0;
        this.totalpesos = 0;
        this.totaldlls = 0;
        this.totalmxn = 0;
        
        
        // console.log(this.fechaInicial);
        // console.log(this.fechaFinal);
        let fecha1;
        let fecha2;
    
        this.fechaInicial = this.sharedService.fecha1
        this.fechaFinal = this.sharedService.fecha2
    
        let dia = this.fechaInicial.getDate();
        let mes = this.fechaInicial.getMonth() + 1;
        let anio = this.fechaInicial.getFullYear();
        fecha1 = anio + '-' + mes + '-' + dia
        
        let dia2 = this.fechaFinal.getDate();
        let mes2 = this.fechaFinal.getMonth() + 1;
        let anio2 = this.fechaFinal.getFullYear();
        fecha2 = anio2 + '-' + mes2 + '-' + dia2
    
        this.rfcE = this.enviarfact.empresa.RFC;
        this.nombreE = this.enviarfact.empresa.RazonSocial;
        this.logo = '../../../assets/images/'+this.rfcE+'.png'
    
        // console.log(fecha1);
        // console.log(fecha2);
    
        // this.facts = [];
    
    
        this.serviceFactura.getFacturasFechas2(fecha1,fecha2).subscribe(data=>{
          
          
          console.log('subscribe 1',data);
          
          for (let i=0; i<data.length; i++ ){
            this.facturas[i] = data[i];
            this.facturas[i].detalle = []
            if(this.facturas[i].Moneda=='MXN'){
              this.totalmxn = +this.totalmxn + +this.facturas[i].Total;
            }else if(this.facturas[i].Moneda=='USD'){
              this.totaldlls = +this.totaldlls + +this.facturas[i].TotalDlls
            }
            this.serviceFactura.getDetallesFacturaList(data[i].Id).subscribe(con =>{
              console.log(con);
              for (let l = 0; l <=con.length-1; l++){
                this.totalkilos = +this.totalkilos + +con[l].Cantidad
                this.totalpesos = +this.totalpesos + +con[l].Importe
                this.facturas[i].detalle.push(con[l]);
              }
          //     console.log(this.totalkilos);
          // console.log(this.totalpesos);
              
              
            })
          }
    
          console.log('antes del service',this.facturas);
    
          
          // this.facts = this.facturas
          
          
    
    
          // this.sharedService.generarReporteFacturacionFechas(this.facturas,fecha1,fecha2);
        })
      }
    
    
